function WordDictionary({data}){
    const items = [
        {
            title : "Definition:",
            content : data.meanings[0].definitions[0].definition
        },
        {
            title : "Parts of speech:",
            content : data.meanings[0].partOfSpeech
        },
        {
            title : "Synonyms:",
            content : data.meanings[0].synonyms[0]
        },
        {
            title : "Antonyms:",
            content : data.meanings[0].antonyms[0]
        }
    ]
    const renderedTitle = items.map(item => <div className="p-2 pe-3">{item.title}</div>)
    const renderedContent = items.map(item => <div className="p-2 pe-3">{item.content}</div>)
    return(
        <div className="d-flex border">
            <div>{renderedTitle}</div>
            <div>{renderedContent}</div>
        </div>
    )
}
export default WordDictionary;
